import React from 'react'

const CalButton = props => {
    const [state, setState] = React.useState()
    const onClickButton = () => {
        console.log(props.character)
    }

    return (
        <button
            className="CalButton"
            onClick={onClickButton}
        >
            {props.character}
        </button>
    )
}

export { CalButton }
